import React, { Suspense } from 'react';
import { Canvas } from '@react-three/fiber';
import SceneManager from './SceneManager';

const ThreeCanvas = () => {
  return (
    <Canvas>
      <ambientLight />
      <pointLight position={[10, 10, 10]} />
      
      <Suspense fallback={null}>
        <SceneManager />
      </Suspense>
    </Canvas>
  );
};

export default ThreeCanvas;
